    list-style: none;
    padding: 10px;
}

summary:hover {
    background: linear-gradient(180deg, #0A2255 0%, #15347B 54%, #0A2255 100%);
    cursor: pointer;
}

summary.selected {
    background: linear-gradient(180deg, #0A2255 0%, #1E48A1 54%, #0A2255 100%);
}

summary:not(:only-child):before {
    content: '';
    position: absolute;
    width: 0;
    height: 0;
    top: 13px;
    left: 20px;
    border: 6px solid white;
    border-top-color: transparent;
    border-right-color: transparent;
    border-bottom-color: transparent;
}

details[open] > summary:not(:only-child):before {
    content: '';
